import React from 'react';
import styled from 'styled-components';

export const MainApp = styled.div`
  padding: 3rem 0;
  width: 80%;
  max-width: 800px;
  text-align: center;
  margin: 0 auto;

  header {
    display: flex;
    flex-wrap: wrap;
    justify-content: space-between;
    border-bottom: 1px solid lightgray;
  }
`;

export const rightHeading = styled.div`
  display: flex;
  flex-wrap: wrap;
  width: 32%;
  align-items: center;
  padding-left: 1rem;
`;
